import React from "react";
import Navbar from "./Components/Navbar";
import News from "./Components/News";
export default function () {
  pagesize = 5;
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route
            exact
            path="/"
            element={
              <News
                key="Home"
                pagesize={pagesize}
                country="in"
                category="general"
              />
            }
          />
          <Route
            exact
            path="/general"
            element={
              <News
                key="general"
                pagesize={pagesize}
                country="in"
                category="general"
              />
            }
          />
          <Route
            exact
            path="/business"
            element={
              <News
                key="business"
                pagesize={pagesize}
                country="in"
                category="business"
              />
            }
          />
          <Route
            exact
            path="/health"
            element={
              <News
                key="health"
                pagesize={pagesize}
                country="in"
                category="health"
              />
            }
          />
          <Route
            exact
            path="/science"
            element={
              <News
                key="science"
                pagesize={pagesize}
                country="in"
                category="science"
              />
            }
          />
          <Route
            exact
            path="/technology"
            element={
              <News
                key="technology"
                pagesize={pagesize}
                country="in"
                category="technology"
              />
            }
          />
          <Route
            exact
            path="/sports"
            element={
              <News
                key="sports"
                pagesize={pagesize}
                country="in"
                category="sports"
              />
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}
